    false,nt"url": null,nt"notes": "Large whale stranding, death, ship strike
    and entanglement incidents are all recorded to monitor the health of each population
    and track anthropogenic factors that influence their recovery.  This Oracle developed
    database is meant to consolidate the various forms of data into one searchable source
    for the east coast.  Biological and geographic information will be recorded and
    searchable along with fishing gear information (entanglements), vessel parameters
    (ship strikes) and serious injury determinations.",nt"license_title": null,nt"extras":
